import { GoogleLogin, GoogleOAuthProvider } from "@react-oauth/google";
import Paper from '@mui/material/Paper';
import jwt_decode from "jwt-decode";

const CLIENT_ID= '61992319078-23ghu3p9na3vjc5qi4fg3mcr2mpgbncp.apps.googleusercontent.com';


function Login()
{

    const handleSuccess = (googleResponse) => {
        console.log(googleResponse);
        const decoded = jwt_decode(googleResponse.credential);
        console.log("credential decoded: ", decoded);
    }


    return (
        <div className="login-page" >
            <Paper className="login-paper" >
                <h1>In The Office</h1>
                <GoogleOAuthProvider clientId={CLIENT_ID}>
                    <GoogleLogin theme="filled_blue"  shape="circle"
                    onSuccess={credentialResponse => handleSuccess(credentialResponse)}
                    onError={() => console.log('Login Failed')}
                    />
                </GoogleOAuthProvider>
            </Paper>
        </div>
    );
}

export default Login;
